import React from 'react';
import { NavLink } from 'react-router-dom';
import './Navbarstyle.css';
import '../../index.js'
import emaillogo from '../../assets/navbar/email.svg';
import githublogo from '../../assets/navbar/github-icon.svg';
import linkedinlogo from '../../assets/navbar/linkedin-app-icon.svg';




function NavBar () {
  return (
    <>

      <nav className='navbar'>
        <div className='brand-title'>Shatlyk Ch</div>
        <div><p className='contact-email'> <img src={emaillogo} alt="LinkedInLogo" className='linkedinlogo' /> Email</p>

          <p className='linkedin'>  <img src={linkedinlogo} alt="LinkedInLogo" className='linkedinlogo' />   Linkedin</p>
          <p> <img src={githublogo} alt="LinkedInLogo" className='githublogo' /> GitHub</p></div>
        <div className='navbar-links'>
          <ul >

            <li><NavLink exact to="/home" activeClassName="active">Home</NavLink></li>
            <li><NavLink to="/about" activeClassName="active">About</NavLink></li>
            <li><NavLink to="/projects" activeClassName="active">Projects</NavLink></li>
            <li><NavLink to="/skills" activeClassName="active">Skills</NavLink></li>
          </ul>
        </div>
      </nav >

    </>
  )

}

export default NavBar;
